import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

function createData(handWash, calories, fat, carbs, protein) {
  return { blank, calories, fat, carbs, protein };
}

const rows = [
  createData(159, 6.0, 24),
  createData(237, 9.0, 37),
  createData(262, 16.0, 24),
  createData(305, 3.7, 67),
  createData(356, 16.0, 49),
];

export default function BasicTable() {
  return (
    <TableContainer component={Paper}>
      CAR
      <Table sx={{ /*INSERT CSS  */}} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell align="right">Hand Wash</TableCell>
            <TableCell align="right">Interior</TableCell>
            <TableCell align="right">Exterior</TableCell>
            <TableCell align="right">Deluxe**</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow
              key={row.name}
              sx={{ '&:last-child td, &:last-child th': { border: 0 },display: "flex", justifyContent: "space-evenly" }}
            >
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.handWash}</TableCell>
              <TableCell align="right">{row.fat}</TableCell>
              <TableCell align="right">{row.carbs}</TableCell>
              <TableCell align="right">{row.protein}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
